import React from "react";
import { today } from "../utils/date-time";

function DateNavButtons({ date, onPrevious, onNext, onToday }) {
  return (
    <div className="btn-toolbar mb-3" role="toolbar">
      <div className="btn-group mr-2" role="group">
        <button type="button" className="btn btn-secondary" onClick={onPrevious}>
          Previous
        </button>
        <button type="button" className="btn btn-secondary" onClick={onToday}>
          Today
        </button>
        <button type="button" className="btn btn-secondary" onClick={onNext}>
          Next
        </button>
      </div>
    </div>
  );
}

export default DateNavButtons;
